import { Pane, Text } from 'evergreen-ui'


export default function TopPanel() {
	return (
		<Pane
			height={60}
			width={'100%'}
			display="flex"
			alignItems="center"
			justifyContent="center"
			border="default"
		></Pane>
	)
}
